import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';
import { HttpClientModule } from '@angular/common/http';
import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';
import { HomeComponent } from './pages/home/home.component';
import { BrowserAnimationsModule } from '@angular/platform-browser/animations';
import {MatDatepickerModule} from '@angular/material/datepicker';
import {MatCardModule} from '@angular/material/card';
import {MatNativeDateModule} from '@angular/material/core';
import { Routes, RouterModule } from '@angular/router';
import { ClasseroomComponent } from './pages/classeroom/classeroom.component';
import { ProfileComponent } from './pages/profile/profile.component';
import { StudentsComponent } from './pages/students/students.component';
import { EmployeeComponent } from './pages/employee/employee.component';
import { AdmissionComponent } from './pages/admission/admission.component';
import { EmpAdmissionComponent } from './pages/emp-admission/emp-admission.component'; 
import { ServiceService } from './services/service.service';

const routes: Routes = [
  { path: '', component: HomeComponent },
  { path: 'classe', component: ClasseroomComponent },
  { path: 'profile', component: ProfileComponent },
  { path: 'student', component: StudentsComponent },
  { path: 'employee', component: EmployeeComponent },
  { path: 'admission', component: AdmissionComponent },
  { path: 'empads', component: EmpAdmissionComponent },

];

@NgModule({
  declarations: [
    AppComponent,
    HomeComponent,
    ClasseroomComponent,
    ProfileComponent,
    StudentsComponent,
    EmployeeComponent,
    AdmissionComponent,
    EmpAdmissionComponent,

  ],
  imports: [
    BrowserModule,
    AppRoutingModule,
    BrowserAnimationsModule,
    MatDatepickerModule,
    MatCardModule,
    MatNativeDateModule,
    HttpClientModule,
    RouterModule.forRoot(routes),
  ],
  exports: [RouterModule],
  providers: [ServiceService],
  bootstrap: [AppComponent]
})
export class AppModule { }
